// Categories.js
import React from 'react';
import './Categories.css'; // Make sure to create a Categories.css file for styling

const Categories = () => {
  return (
    <div className="categories-container">
      <div className="category">Emergencies</div>
      <div className="category">Finances</div>
      <div className="category">Office & Admin</div>
      <div className="category">Events</div>
      <div className="category">Communications</div>
      <div className="category">Travel</div>
      <div className="category">Tech Support</div>
      <div className="category">All CTL</div>
      <div className="category">CTL Managers</div>
    </div>
  );
}

export default Categories;
